import React from "react";
import styled from "styled-components";

const Button =(props) => {
    return(
        <React.Fragment>
            <Button></Button>
        </React.Fragment>
    )
}

Button.defaultProps ={
    text:"텍스트",
    _onClick: () => {}
}


const ElButton = styled.button`
    width: 100%;
    background-color : #212121;
    color: #ffffff;
    padding: 12px 0px;

`;

export default Button;
